import React from 'react'

export default function Contacts() {
    return (
        <div>
            <a href="https://github.com/asar2030"><img src="https://raw.githubusercontent.com/gilbarbara/logos/master/logos/github-icon.svg" alt="github"/></a>
            <a href="https://www.linkedin.com/in/asar-akhmetbekov-09b96b201/"><img src="https://raw.githubusercontent.com/gilbarbara/logos/master/logos/linkedin.svg" alt="linkedin"/></a>
            <a href="https://github.com/asar2030"><img src="https://raw.githubusercontent.com/gilbarbara/logos/master/logos/instagram-icon.svg" alt="instagram"/></a>
        </div>
    )
}
